import React from "react";

export default function ContainerContact(img, name, data, cost) {


    return (

        <div className='containerContact'>
            <img src={props.img} alt='Img' />
            <h1>
                <div>{props.name}</div>
                <div>{props.data}</div>
                <div>{props.cost}</div>

            </h1>
        </div>

    )
}
